import React from 'react';
import BluetoothComponent from './components/BluetoothComponent';
import ChatComponent from './components/ChatRoom';



const ParentComponent = () => {
  let receiveBluetoothMessage;

  const onReceiveBluetoothMessage = (callback) => {
    receiveBluetoothMessage = callback;
  };

  return (
    <div>
      <BluetoothComponent onReceiveBluetoothMessage={receiveBluetoothMessage} />
      <ChatComponent onReceiveBluetoothMessage={onReceiveBluetoothMessage} />
    </div>
  );
};

export default ParentComponent;
